import * as React from "react";
import { styled, alpha } from "@mui/material/styles";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import InputBase from "@mui/material/InputBase";
import SearchIcon from "@mui/icons-material/Search";
import { useState } from "react";
import { fetchTracks } from "../../api/track/trackApi";
import { GetModel } from "../../api/track/models/CreateTrack";
import { Track } from "../../api/track/models/Track";
import { PageList } from "../../types/PageList";
import { Typography } from "@mui/material";

const Search = styled("div")(({ theme }) => ({
  position: "relative",
  borderRadius: theme.shape.borderRadius,
  backgroundColor: alpha("#3E2723", 0.1),
  "&:hover": {
    backgroundColor: alpha("#3E2723", 0.2),
  },
  marginLeft: 0,
  width: "100%",
  [theme.breakpoints.up("sm")]: {
    marginLeft: theme.spacing(1),
    width: "auto",
  },
}));

const SearchIconWrapper = styled("div")(({ theme }) => ({
  padding: theme.spacing(0, 2),
  height: "100%",
  position: "absolute",
  pointerEvents: "none",
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
  color: "#3E2723",
}));

const StyledInputBase = styled(InputBase)(({ theme }) => ({
  color: "#3E2723",
  width: "100%",
  "& .MuiInputBase-input": {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)})`,
    transition: theme.transitions.create("width"),
    [theme.breakpoints.up("sm")]: {
      width: "12ch",
      "&:focus": {
        width: "20ch",
      },
    },
  },
}));

type Props = {
  onSearch: (results: PageList<Track>) => void;
};

export const SearchAppBar: React.FC<Props> = ({ onSearch }) => {
  const [input, setInput] = useState("");
  const [allTracks, setAlltracks] = useState<Track[]>([]);
  const [searchResults, setSearchResults] = useState<PageList<Track> | null>(
    null
  );

  const searchTrack = async (value: string) => {
    setInput(value);

    const model: GetModel = {
      page: 1,
      limit: 100,
      sort: "",
      search: value,
      genre: "",
      artist: "",
      order: "asc",
    };

    const response = await fetchTracks(model);

    if (response && response.data) {
      setAlltracks(response.data);
      setSearchResults(response);
      onSearch(response);
    } else {
      setSearchResults({
        data: [],
        meta: { page: 1, limit: 10, total: 0, totalPages: 0 },
      });
      onSearch({
        data: [],
        meta: { page: 1, limit: 10, total: 0, totalPages: 0 },
      });
    }
  };

  return (
    <Box
      sx={{
        width: "100%",
        display: "flex",
        justifyContent: "center",
        mt: 4,
      }}
    >
      <Box
        sx={{
          position: "relative",
          width: "100%",
          maxWidth: 700,
        }}
      >
        {/* Gradient glow */}
        <Box
          sx={{
            position: "absolute",
            inset: 0,
            borderRadius: 4,
            background:
              "linear-gradient(135deg, #667eea, #764ba2, #f093fb, #4facfe)",
            filter: "blur(20px)",
            opacity: 0,
            transition: "opacity 0.4s ease",
            "&:focus-within": {
              opacity: 0.6,
            },
          }}
        />

        {/* Search input */}
        <Box
          sx={{
            position: "relative",
            display: "flex",
            alignItems: "center",
            background: "rgba(255,255,255,0.95)",
            backdropFilter: "blur(12px)",
            borderRadius: 4,
            px: 3,
            py: 1.5,
            border: "1px solid rgba(102,126,234,0.15)",
            boxShadow: "0 4px 12px rgba(102,126,234,0.1)",
            transition: "all 0.3s ease",
            "&:hover": {
              boxShadow: "0 8px 24px rgba(102,126,234,0.2)",
            },
            "&:focus-within": {
              border: "1px solid rgba(102,126,234,0.5)",
              boxShadow: "0 12px 36px rgba(102,126,234,0.25)",
            },
          }}
        >
          <SearchIcon sx={{ color: "#667eea", mr: 2 }} />
          <InputBase
            placeholder="Search for tracks, artists, albums..."
            value={input}
            onChange={(e) => setInput(e.target.value)}
            onKeyDown={(e) => {
              if (e.key === "Enter") onSearch(input);
            }}
            sx={{
              flex: 1,
              fontSize: "1rem",
              color: "#0f172a",
              "& input::placeholder": {
                color: "#94a3b8",
              },
            }}
          />

          {input && (
            <Typography
              sx={{
                ml: 2,
                px: 2,
                py: 0.5,
                borderRadius: 2,
                background: "linear-gradient(135deg, #667eea, #764ba2)",
                color: "#fff",
                fontWeight: 600,
                fontSize: "0.8rem",
                cursor: "pointer",
                userSelect: "none",
                transition: "all 0.2s ease",
                "&:hover": {
                  opacity: 0.85,
                  transform: "scale(1.05)",
                },
              }}
              onClick={() => onSearch(input)}
            >
              Enter ↵
            </Typography>
          )}
        </Box>
      </Box>
    </Box>
  );
};
